INSERT INTO `Users` VALUES (2,'ttnhang_20pm@student.agu.edu.vn',NULL,'Nhàng','Trần Thanh','Xã Mường Mùn, Huyện Tuần Giáo, Tỉnh Điện Biên','2023-01-18 07:00:00','F','R0','097454123',_binary 'data:image/jpeg;base64,','<h2>Lịch sử[<a href=\"https://vi.wikipedia.org/w/index.php?title=Blog&amp;veaction=edit&amp;section=1\">sửa</a> | <a href=\"https://vi.wikipedia.org/w/index.php?title=Blog&amp;action=edit&amp;section=1\">sửa mã nguồn</a>]</h2><p><a href=\"https://vi.wikipedia.org/w/index.php?title=Tin_th%E1%BB%9Di_s%E1%BB%B1&amp;action=edit&amp;redlink=1\">Tin thời sự</a>, <a href=\"https://vi.wikipedia.org/wiki/S%E1%BB%95_tay\">sổ tay</a> và <a href=\"https://vi.wikipedia.org/w/index.php?title=Nh%E1%BA%ADt_k%C3%BD_c%C3%A1_nh%C3%A2n&amp;action=edit&amp;redlink=1\">nhật ký cá nhân</a> có thể được coi là những ông tổ của blog.</p><p>Trước khi blog trở nên phổ biến thì các tổ chức xã hội trên mạng mang nhiều hình thức, bao gồm <a href=\"https://vi.wikipedia.org/wiki/Usenet\">Usenet</a>, các dịch vụ kinh doanh trực tuyến như <a href=\"https://vi.wikipedia.org/w/index.php?title=GEnie&amp;action=edit&amp;redlink=1\">GEnie</a>, BiX và <a href=\"https://vi.wikipedia.org/wiki/CompuServe\">CompuServe</a>, gồm cả <a href=\"https://vi.wikipedia.org/w/index.php?title=Danh_s%C3%A1ch_email&amp;action=edit&amp;redlink=1\">danh sách email</a><a href=\"https://vi.wikipedia.org/wiki/Blog#cite_note-2\">[2]</a> và các <a href=\"https://vi.wikipedia.org/w/index.php?title=H%E1%BB%87_th%E1%BB%91ng_b%E1%BA%A3ng_tin_nh%E1%BA%AFn_%C4%91i%E1%BB%87n_t%E1%BB%AD&amp;action=edit&amp;redlink=1\">hệ thống bảng tin nhắn điện tử</a> (BBS). Trong thập niên 1990, các phần mềm <a href=\"https://vi.wikipedia.org/wiki/Di%E1%BB%85n_%C4%91%C3%A0n_tr%E1%BB%B1c_tuy%E1%BA%BFn\">diễn đàn Internet</a> như <a href=\"https://vi.wikipedia.org/w/index.php?title=WebEx&amp;action=edit&amp;redlink=1\">WebEx</a>, tạo ra các luồng trao đổi thông tin (<i>thread</i>). Các luồng thông tin là các kết nối giữa các lời nhắn trao đổi cùng topic trên một bảng trực tuyến. Một số người đã coi blog là phong trào <a href=\"https://vi.wikipedia.org/w/index.php?title=Quan_s%C3%A1t_t%E1%BA%ADp_th%E1%BB%83&amp;action=edit&amp;redlink=1\">quan sát tập thể</a> của <a href=\"https://vi.wikipedia.org/wiki/Th%E1%BA%BF_k%E1%BB%B7_20\">thế kỷ 20</a>.</p>',NULL,NULL,NULL,NULL,1,'2023-07-18 20:03:20','2023-08-05 10:06:39'),(3,'nhangnhanh1234@gmail.com',NULL,'Thanh','Nhang JDK 17',NULL,'2001-11-01 07:00:00','F','R1',NULL,_binary 'data:image/jpeg;base64,','<p>adsd</p>',NULL,'https://www.facebook.com/thanhnhang.tran.96','https://www.youtube.com/channel/UC86ViGOu_dOMpIVPRTrjD0w','Alo',1,'2023-07-20 19:51:56','2023-08-05 09:59:28'),(4,'ttnhang@gmail.com','$2a$10$fPqei.EC1cU8US4wr4rlG.3H4u3pXlyfYlJuxrNsgZCMuL2fO1JUC','Thiện','Judas','An Giang','2001-07-11 07:00:00','F','R1','069754511','',NULL,NULL,NULL,NULL,NULL,1,'2023-07-27 19:49:19','2023-07-27 19:49:19'),(5,'ttnhaaaang@gmail.com','$2a$10$fPqei.EC1cU8US4wr4rlG.3H4u3pXlyfYlJuxrNsgZCMuL2fO1JUC','Mít','Tuổi','Cà Nay','2001-07-11 07:00:00','F','R1','069754511','',NULL,NULL,NULL,NULL,NULL,1,'2023-07-27 19:49:49','2023-07-27 19:49:49'),(6,'ttnhang123@gmail.com','$2a$10$v0BqZqrcRy2E7I2dMDW8G.AS5gvX5cUTpssiHpZq7XZKGDNCI5lmO','Hello','Chị Cả',' ','2002-06-26 07:00:00','M','R1','0972667944','',NULL,NULL,NULL,NULL,NULL,1,'2023-07-31 16:18:22','2023-07-31 16:18:22'),(7,'ttnh27102001@gmail.com','$2a$10$vwakutPbE.UruNo5wzRiDu37WXfdqdV6fj/93iu/.000TfZqurSL2','Ngọc','Hạnh',NULL,NULL,'F',NULL,'097455121',NULL,'',NULL,NULL,NULL,NULL,1,'2023-07-31 16:23:57','2023-08-04 13:48:07'),(9,'ttnhandddg@gmail.com','$2a$10$2FsCA73HbQS8W69WEMkIpuTl9xaTFXQzUxKHBnCr8plpCVt/GqXti','Hạo','Nam','An Giang','2001-08-02 07:00:00','M','R1','097455123','',NULL,NULL,NULL,NULL,NULL,1,'2023-08-03 08:38:50','2023-08-03 08:38:50'),(10,'ttdddg@gmail.com','$2a$10$2FsCA73HbQS8W69WEMkIpuTl9xaTFXQzUxKHBnCr8plpCVt/GqXti','Óc','Ma','An Giang','2001-08-02 07:00:00','M','R1','01212474841','',NULL,NULL,NULL,NULL,NULL,